require.config({"config": {
        "text":{"Magento_Ui/templates/grid/cells/actions.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<a\n    class=\"action-menu-item\"\n    if=\"$col.isSingle($row()._rowIndex)\"\n    repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\"\n    click=\"$col.getActionHandler($action())\"\n    text=\"$action().label\"\n    attr=\"target: $col.getTarget($action()), href: $action().href, 'aria-label': $action().ariaLabel\"></a>\n\n<div class=\"action-select-wrap\" if=\"$col.isMultiple($row()._rowIndex)\" collapsible>\n    <button class=\"action-select\" translate=\"'Select'\" toggleCollapsible></button>\n    <ul class=\"action-menu\" css=\"_active: $collapsible.opened\">\n        <li repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\">\n            <a class=\"action-menu-item\" click=\"$col.getActionHandler($action())\" text=\"$action().label\" attr=\"target: $col.getTarget($action()), href: $action().href, 'data-action': 'item-' + $action().index\"></a>\n        </li>\n    </ul>\n</div>\n"}
}});
